import React from 'react';
import Article from '../components/article/Article';
import { blog01, blog02, blog03, blog04, blog05 } from './import';
import './blog.css';
import ai from '../assets/ai.png';
import './header.css';

const Home = () => (
  <div className="gpt3__blog section__padding" id="blog">
    <div className="gpt3__header section__padding" id="home">
      <div className="gpt3__header-content">
        <h1 className="gradient__text">
          Hacker Vaillant, Rien d&apos; impossible
        </h1>
        <p>
          « le Hacking est la compétence la plus importante du 21ème siècle »
          <br />
          <i>Occupy The Web</i>
        </p>
      </div>

      <div className="gpt3__header-image">
        <img src={ai} />
      </div>
    </div>
    <div className="gpt3__blog-container">
      <div className="gpt3__blog-container_groupA">
        <a href="/linux"> Linux</a>
        <Article
          imgUrl={blog01}
          // date="Sep 26, 2021"
          text="Linux Basics, débuter avec Linux"
        />
      </div>

      <div className="gpt3__blog-container_groupB">
        <Article
          imgUrl={blog02}
          date="Sep 26, 2021"
          text="Networks Basics, fondamentaux Réseaux"
        />
        <Article imgUrl={blog03} date="Sep 26, 2021" text="Wifi Hacking" />
        <Article imgUrl={blog04} date="Sep 26, 2021" text="SCADA Hacking" />
        <Article
          imgUrl={blog05}
          date="Sep 26, 2021"
          text="Web Hacking,failles & exploits"
        />
        <Article
          imgUrl={blog05}
          date="Sep 26, 2021"
          text="PassiveRecon, Dnsenum, Shodan..."
        />
        <Article
          imgUrl={blog05}
          date="Sep 26, 2021"
          text="ActiveRecon, nmap ..."
        />
      </div>
    </div>
  </div>
);

export default Home;
